import React, { Component } from 'react'

class Table extends Component {
    render() {
        const items = this.props.data.items;
        return (
            <div>
                <table id="Skills">
                    <thead>
                        <tr>
                            <th>Name</th>
                            <th>GithubLink</th>
                            <th>Email</th>
                            <th>location</th>
                            <th>Public Repos</th>
                            <th>Bio</th>
                            </tr>
                    </thead>
                    <tbody>
                        {items.map(item => {
                            return (
                                <tr>
                                    <td>{item.name}</td>
                                    <td>{item.html_url}</td>
                                    <td>{item.Email}</td>
                                    <td>{item.location}</td>
                                    <td>{item.public_repos}</td>
                                    <td>{item.bio}</td>
                                </tr>
                            );
                        })}
                    </tbody>
                </table>

            </div>
        )
    }
}

export default Table
